gqA(){return"Informativa sulla privacy \u2013 Applicazione ASConnect\n\n1) Identit\xe0 del titolare del trattamento\nI dati raccolti nell\u2019applicazione ASConnect sono trattati da AngelmanAnalytics in qualit\xe0 di titolare del trattamento.\nPer qualsiasi domanda relativa ai dati o all\u2019esercizio dei diritti, \xe8 possibile contattarci all\u2019indirizzo: contact@angelmananalytics.org.\n____________________________________________\n2) Finalit\xe0 del trattamento\nI trattamenti dei dati effettuati tramite l\u2019applicazione perseguono le seguenti finalit\xe0:\n\u2022 Creazione e gestione dell\u2019account utente per un accesso nominativo all\u2019applicazione ASConnect;\n\u2022 Utilizzo delle funzionalit\xe0 di geolocalizzazione per visualizzare:\n  o Profili di persone interessate secondo diversi criteri (distanza geografica, genotipo, fascia di et\xe0);\n  o Miglioramento del servizio e personalizzazione dell\u2019esperienza utente.\n\u2022 Estrazione di dati che non consentono l\u2019identificazione delle persone a fini statistici: numero di persone affette dalla sindrome di Angelman, distribuzione per et\xe0...\n____________________________________________\n3) Categorie di dati raccolti\nPossono essere raccolti i seguenti dati:\n\u2022 Dati identificativi:\n  o sesso, nome, cognome, indirizzo email, password, fotografia,\n  o domanda e risposta segreta (in caso di smarrimento della password);\n\u2022 Dati sensibili:\n  o genotipo, localizzazione.\nLa base giuridica di tali trattamenti \xe8 il consenso esplicito e informato dell\u2019utente.\n____________________________________________\n4) Periodo di conservazione dei dati\nI dati sono conservati per tutta la durata dell\u2019utilizzo dell\u2019account e successivamente cancellati entro un periodo massimo di 12 mesi dall\u2019ultima attivit\xe0.\nL\u2019utente pu\xf2 esercitare in qualsiasi momento il diritto all\u2019oblio direttamente nell\u2019applicazione tramite il menu:\nInformativa sulla privacy \u2192 Diritto all\u2019oblio.\n____________________________________________\n5) Destinatari e hosting dei dati\nI dati sono ospitati in modo sicuro sui server di PythonAnywhere.\nI dati sono archiviati all\u2019interno dell\u2019Unione Europea.\n(Per maggiori informazioni sulla politica di protezione dei dati del fornitore, consultare https://www.pythonanywhere.com/privacy/.)\nL\u2019applicazione web \xe8 ospitata da O2Switch in Francia, consultare https://www.o2switch.fr/du-rgpd.pdf.\n____________________________________________\n6) Diritti degli utenti\nAi sensi del Regolamento (UE) 2016/679 (GDPR), gli utenti dispongono dei seguenti diritti:\n\u2022 Diritto di accesso, rettifica e cancellazione (\xabdiritto all\u2019oblio\xbb) \u2014 direttamente tramite il profilo o il menu Informativa sulla privacy \u2192 Diritto all\u2019oblio;\n\u2022 Diritto di opposizione, portabilit\xe0 e limitazione del trattamento;\n\u2022 Diritto di revocare il consenso in qualsiasi momento.\nPer esercitare tali diritti (diversi dal diritto all\u2019oblio accessibile dall\u2019applicazione), \xe8 possibile inviare un\u2019email a contact@angelmananalytics.org.\n____________________________________________\n7) Sicurezza e riservatezza\nTutti i dati sono cifrati durante l\u2019archiviazione e la trasmissione.\nLe password sono trattate secondo le migliori pratiche di sicurezza e tutte le comunicazioni con il servizio avvengono tramite il protocollo HTTPS.\n____________________________________________\n8) Consenso esplicito\nLa registrazione all\u2019applicazione ASConnect richiede il consenso esplicito e informato dell\u2019utente per i trattamenti descritti nella sezione 2.\nL\u2019utente pu\xf2 revocare tale consenso in qualsiasi momento tramite le impostazioni del proprio account o contattando direttamente contact@angelmananalytics.org."},
